******** The Devil's Tomb (2009) ********


Verenigde Staten
Horror / Science-Fiction
90 minuten

geregisseerd door Jason Connery
met Cuba Gooding Jr., Ray Winstone en Ron Perlman

Een team archeologen is in een woestijn in het Midden-Oosten bezig met het 
zoeken naar top geheime resten. Als een wetenschapper (de leider) plotseling 
verdwijnt, wordt een groep militairen gestuurd, om hem op te sporen en te 
redden. Kapitein Mack en zijn team worden al snel geconfronteerd met het 
kwaad, wat onder de woestijn leeft.

